import React, { Component } from 'react';
import "../css/components/navbar.css";


const Navbar = () => {
    return ( 
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark" id="home-navbar">
            <a className="navbar-brand" href="#">Qlick2Learn</a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarContent" aria-controls="navbarContent" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>

            <div class="collapse navbar-collapse" id="navbarContent">
                <ul class="navbar-nav mr-auto">
                    <li><a class="nav-item nav-link" href="#">Courses</a></li>
                    <li><a class="nav-item nav-link" href="#">News</a></li>
                    <li><a class="nav-item nav-link" href="#">Find an Expert</a></li>
                    <li><a class="nav-item nav-link" href="#">Contact Us</a></li>
                </ul>
            </div>
        </nav> 
        );
}
 
export default Navbar;
